import React from 'react'

import './css/home.css'
import './css/main.css'

var mock_art = [
  {title: "Nowy sprzęt", content:"właśnie kupiłem nowy sprzęt"},
  {title: "Nowy samochód", content:"właśnie kupiłem nowy samochód"},
  {title: "Rozbudowa strony", content:"Strona internetowa, na której przebywasz jest w przebudowie, przepraszamy za utrudnienia"}];

export class Home extends React.Component {
  render(){
    return(<>
            <div className="headerPane">Co nowego ?</div>
            <NewsContainer></NewsContainer>
            <div className="headerPane">Serwisy społecznościowe</div>
            Zapraszamy do śledzenia wszystkich informacji na serwisach społecznościowych
          </>);
  }
}

export class NewsContainer extends React.Component {
  render(){
    return(<div className="newsContainer">{mock_art.map(object => <NewsPane>{object}</NewsPane>)}</div>);
  }
}

export class NewsPane extends React.Component {
  render(){
    console.log(this.props.children)
    return(
          <div className="newsPane">
            <div className="newsHeader">
              {this.props.children.title}
              <hr align="center"></hr>
            </div>
            <div className="newsContent">{this.props.children.content}</div>
          </div>);
  }
}
